import React from "react";

//Import CSS
import "./ServicesCard.css";

import ServicesItem from "./servicesItem/ServicesItem";

const ServicesCard = () => {
  return (
    <>
      <h1>Services</h1>
      <div className="wrapper">
        <ServicesItem name="1" description="We deliver anywhere in the United States" />
        <ServicesItem name="2" description="We deliver anywhere in the United States" />
        <ServicesItem name="3" description="We deliver anywhere in the United States" />
        <ServicesItem name="4" description="We deliver anywhere in the United States" />
      </div>
    </>
  );
};

export default ServicesCard;
